import React from 'react'
import './header.css'
import { Transition } from "react-transition-group";

const AComponent = ({ in: inProp }) => (
    <Transition in={inProp} timeout={500}>
        {state => (
            <div>
                I am {state}
            </div>
        )}
    </Transition>
);

const Header = ({ headerToggle, headerButtonPressed }) => {

    return (
        <div
    >
          <AComponent in={headerToggle} />
            <button
              onClick={() => {
                headerButtonPressed(!headerToggle);
              }}
            >
              Toggle Entered
            </button>
        </div>
      );
    }

export default Header
